import { Button,TextField } from '@material-ui/core'
import React, { useState } from 'react'
import '../Style/WindowLogin.css'
import AccountBoxIcon from '@material-ui/icons/AccountBox';

function WindowLogin() {
    const [windowStatus, setWindowStatus] = useState(true)
    const [login, setLogin] = useState(true)
    window.onclick = function(event) {
        if(event.target.className == 'windowlogin-modal'){
            setWindowStatus(false)
        }
    }
    function handleClickTitle(){
        setLogin(!login)
    }
    return (
        <>
        {windowStatus?
        (
            <div className={'windowlogin-modal'}>
                <div className='windowlogin-container'>
                    <div className='windowlogin-box'>
                        <div className='windowlogin-title'>
                            {login?
                            (
                                <>
                                    <Button variant="contained" style={{backgroundColor:'#2D312F', color:'white'}}>Log In</Button>
                                    <Button onClick={handleClickTitle}>Sign In</Button>
                                </>
                            ):(
                                <>
                                    <Button>Log In</Button>
                                    <Button  variant="contained" style={{backgroundColor:'#2D312F', color:'white'}}>Sign In</Button>
                                </>
                            )}
                        </div>
                        <AccountBoxIcon style={{fontSize:80, color:'2D312F'}}/>
                        <TextField label="Private Key"/>
                        <Button>LOGIN</Button>
                    </div>
                </div>
            </div>
        ):(
            <></>
        )}
        </>
    )
}

export default WindowLogin
